CREATE TABLE `role` (
  `id` varchar(32) NOT NULL COMMENT '角色id',
  `code` varchar(64) NOT NULL COMMENT '角色识别码',
  `name` varchar(32) NOT NULL COMMENT '角色名',
  `created_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
