-- ----------------------------
--  Table structure for `staff`
-- ----------------------------
DROP TABLE IF EXISTS `staff`;
CREATE TABLE `staff` (
  `id` varchar(32) NOT NULL COMMENT 'id',
  `type` varchar(32) NOT NULL COMMENT '人员类型：超级管理员，上级管理员，社区管理员（租户），社区工作人员',
  `username` varchar(128) NOT NULL COMMENT '用户名',
  `password` varchar(32) NOT NULL COMMENT '密码',
  `salt` varchar(32) NOT NULL COMMENT '盐',
  `phone` varchar(16) DEFAULT NULL COMMENT '手机号',
  `email` varchar(32) DEFAULT NULL COMMENT '邮箱',
  `avatar_url` text COMMENT '头像',
  `last_login_ip` varchar(64) DEFAULT NULL COMMENT '上次登录ip',
  `birthday` varchar(32) NOT NULL DEFAULT '' COMMENT '生日',
  `gender` varchar(16) NOT NULL DEFAULT '' COMMENT '性别',
  `location` varchar(255) NOT NULL DEFAULT '' COMMENT '位置',
  `is_test` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否测试',
  `deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除状态',
  `locked` tinyint(1) NOT NULL DEFAULT '0' COMMENT '锁定状态',
  `locked_time` datetime DEFAULT NULL COMMENT '锁定时间',
  `ua` text,
  `device_token` text,
  `tenant_id` varchar(32) NOT NULL COMMENT '租户id，区分租户子账号',
  `created_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `version` int(11) DEFAULT '1' COMMENT '乐观锁',
  `operator` varchar(32) DEFAULT NULL COMMENT '操作人员id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='工作人员表';

